import React from 'react';

export default function UserDashboard() {
  // Exemple de données statiques, à remplacer par des appels API si besoin
  const reservations = [
    { id: 1, description: 'Réservation Table pour 4', date: '2025-07-10' },
    { id: 2, description: 'Réservation Table pour 2', date: '2025-07-15' },
  ];

  const commandes = [
    { id: 12345, status: 'En préparation' },
    { id: 12344, status: 'Livrée' },
  ];

  return (
    <div style={styles.container}>
      <h1 style={styles.title}>Tableau de bord Utilisateur</h1>
      <p style={styles.welcome}>Bienvenue dans votre espace personnel.</p>

      <section style={styles.section}>
        <h2>Mes réservations</h2>
        {reservations.length === 0 ? (
          <p>Aucune réservation active.</p>
        ) : (
          <ul>
            {reservations.map(r => (
              <li key={r.id}>{r.description} - {r.date}</li>
            ))}
          </ul>
        )}
        <button style={styles.button} onClick={() => alert('Nouvelle réservation')}>
          Nouvelle réservation
        </button>
      </section>

      <section style={styles.section}>
        <h2>Mes commandes récentes</h2>
        <ul>
          {commandes.map(c => (
            <li key={c.id}>Commande #{c.id} - {c.status}</li>
          ))}
        </ul>
      </section>

      <section style={styles.section}>
        <h2>Notifications</h2>
        <p>Profitez de 10% de réduction ce week-end !</p>
      </section>
    </div>
  );
}

const styles = {
  container: {
    maxWidth: 800,
    margin: 'auto',
    padding: 20,
    fontFamily: 'Arial, sans-serif',
  },
  title: {
    fontSize: 28,
    marginBottom: 10,
  },
  welcome: {
    fontSize: 18,
    marginBottom: 20,
  },
  section: {
    marginBottom: 30,
  },
  button: {
    padding: '10px 20px',
    backgroundColor: '#3b82f6',
    color: 'white',
    border: 'none',
    borderRadius: 5,
    cursor: 'pointer',
  },
};
